import React from "react";
import { useColorModeValue, Box, Heading } from "@chakra-ui/react";

// Spotracks

function Home() {
    const color = useColorModeValue("gray.700", "blue.500");
    return (
        <Box mt="40" mb="20" textAlign="center">
            <Heading fontWeight="700" color="test" fontSize="36px">
                Visualize Your Tracks
            </Heading>

            <Box mt="4">
                <Heading color={color} fontWeight="300" fontSize="20px">
                    See listening trends from the past <br />
                    and discover new tracks for the future
                </Heading>
            </Box>
        </Box>
    );
}

export default Home;
